import React, { useEffect, useState } from 'react'
import "./Feed.css"
import Tweetbox from './Tweetbox'
import axios from 'axios';

function Feed() {
  const [ posts, setposts ]= useState([]);
  useEffect(()=>{
    axios.get("http://localhost:5000/loggedInUser?email=mayur@gmail.com")
  },[])
  return (
    <div>
      <h4>Home</h4>
      <Tweetbox/>
    </div>
  )
}

export default Feed
